# ChomskyNormalForm class
class ChomskyNormalForm:
    def __init__(self, s):
        self.s = s

    def generate_string(self, s):
        result = []

        # Find the first occurrence of the string in the grammar
        start_index = -1
        for i in range(len(s)):
            if s[i:i+len(s)] == s:
                start_index = i
                break

        if start_index == -1:
            return ""

        result.append(s[start_index:])

        for i in range(start_index + 1, len(s)):
            if s[i:i+len(s)] == s:
                result.append(s[start_index:i])
                start_index = i

        return "".join(result)

